import Footer from '../Footer/Footer'

function MainPage() {
    const [search, setSearch] = React.useState('')

    return (
        <BrowserRouter>
            <Routes>
             <>
                    <Header search={search} setSearch={setSearch} />
                    <Categorie />
                    <MiniListCard />           
                    <ListCard search={search} />
                    <Footer />
             </>
        //     </Routes>
        // </BrowserRouter>
    )
}

export default MainPage
